import styled from 'styled-components';

export const Aside = styled.aside`
  position: fixed;
  width: 18%;
  min-height: 100%;
  background-color: red;

  margin-left: -17%;

  padding: 8rem 8rem;

  transition: margin-left 0.125s cubic-bezier(0.25, 0.75, 0.5, 1.25) 0.01s;

  ul {
    li:not(:last-child) {
      margin-bottom: 2rem;
    }
  }
`;
